    false,nt"url": null,nt"notes": "The Arkansas House of Representatives has
    100 Members, representing 100 separate districts statewide. We are pleased to provide
    you a quick and easy way to locate the representative from your district. Click
    on the map or enter your address to find who represents you. You must enter your
    street address, city, state, and zip code, ALL separated by commas. (Example: 000
    South Main Street, Little Rock, Arkansas, 72201). House districts appear outlined
    in red. You can also view statewide Senate, congressional, fire and school districts
    by clicking on the "District" tab and selecting a category. To view maps showing
    topographical, image, or street-level information, select from the "Map Types"
    tab.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
